import React, { useState, useEffect } from 'react';
import {
    Box,
    Paper,
    Typography,
    Divider,
    CircularProgress,
    Alert
} from '@mui/material';
import { API_BASE_URL } from '../config';

function StageView({ stageId }) {
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [stageData, setStageData] = useState(null);

    useEffect(() => {
        const fetchStageData = async () => {
            if (!stageId) {
                setLoading(false);
                return;
            }

            try {
                setLoading(true);
                setError(null);
                
                const businessId = localStorage.getItem('businessId');
                if (!businessId) {
                    throw new Error('No business ID found in local storage');
                }

                const response = await fetch(`${API_BASE_URL}/stages/${stageId}?business_id=${businessId}`, {
                    method: 'GET',
                    headers: {
                        'Accept': 'application/json'
                    },
                    credentials: 'include'
                });

                if (!response.ok) {
                    const errorData = await response.json().catch(() => ({}));
                    throw new Error(errorData.error || `Failed to fetch stage data (${response.status})`);
                }

                const data = await response.json();
                console.log('Stage data:', data);
                setStageData(data);
            } catch (err) {
                console.error('Error fetching stage:', err);
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };

        fetchStageData();
    }, [stageId]);

    if (loading) {
        return (
            <Box display="flex" justifyContent="center" p={3}>
                <CircularProgress />
            </Box>
        );
    }

    if (error) {
        return (
            <Alert severity="error" sx={{ mt: 2 }}>
                {error}
            </Alert>
        );
    }

    if (!stageData) {
        return (
            <Alert severity="info" sx={{ mt: 2 }}>
                No stage data available
            </Alert>
        );
    }

    return (
        <Paper sx={{ p: 3, mt: 2 }}>
            <Typography variant="h6" gutterBottom>
                Stage Details
            </Typography>
            <Divider sx={{ mb: 2 }} />
            
            <Box mb={2}>
                <Typography variant="subtitle2" color="primary">Name</Typography>
                <Typography>{stageData.stage_name}</Typography>
            </Box>

            <Box mb={2}>
                <Typography variant="subtitle2" color="primary">Description</Typography>
                <Typography>{stageData.stage_description || 'No description'}</Typography>
            </Box>

            <Box mb={2}>
                <Typography variant="subtitle2" color="primary">Type</Typography>
                <Typography>{stageData.stage_type}</Typography>
            </Box>

            <Box mb={2}>
                <Typography variant="subtitle2" color="primary">Stage ID</Typography>
                <Typography component="code">{stageData.stage_id}</Typography>
            </Box>

            <Box mb={2}>
                <Typography variant="subtitle2" color="primary">Business ID</Typography>
                <Typography component="code">{stageData.business_id}</Typography>
            </Box>

            {stageData.agent_id && (
                <Box mb={2}>
                    <Typography variant="subtitle2" color="primary">Agent ID</Typography>
                    <Typography component="code">{stageData.agent_id}</Typography>
                </Box>
            )}

            <Typography variant="h6" sx={{ mt: 4, mb: 2 }}>Template Configuration</Typography>
            <Divider sx={{ mb: 2 }} />

            <Box mb={2}>
                <Typography variant="subtitle2" color="primary">Stage Selection Template ID</Typography>
                <Typography component="code">
                    {stageData.stage_selection_template_id || 'Not configured'}
                </Typography>
            </Box>

            <Box mb={2}>
                <Typography variant="subtitle2" color="primary">Data Extraction Template ID</Typography>
                <Typography component="code">
                    {stageData.data_extraction_template_id || 'Not configured'}
                </Typography>
            </Box>

            <Box mb={2}>
                <Typography variant="subtitle2" color="primary">Response Generation Template ID</Typography>
                <Typography component="code">
                    {stageData.response_generation_template_id || 'Not configured'}
                </Typography>
            </Box>

            {stageData.created_at && (
                <Box mt={4}>
                    <Typography variant="caption" color="text.secondary">
                        Created: {new Date(stageData.created_at).toLocaleString()}
                    </Typography>
                </Box>
            )}
        </Paper>
    );
}

export default StageView;
